import * as React from 'react';
import {
  Button,
  View,
  Text,
  SafeAreaView
} from 'react-native';
import { Box, HStack, Stack, Center, NativeBaseProvider, Container, Heading } from "native-base"

const FirstPage = ({ navigation }) => {
  return (
    <SafeAreaView>
    <Container>
        <Stack space={3} alignItems="center">
{/*       <Heading>HStack</Heading> */}
      <HStack space={4} alignItems="center">
        <Center
          width="50%"
          height="50%"
          bg="primary.400"
          rounded="md"
          _text={{
            color: "white",
          }}
          shadow={3}
        >
          Remember keys
        </Center>
        <Center
          bg="secondary.400"
          size={16}
          rounded="md"
          _text={{
            color: "white",
          }}
          shadow={3}
        >
          Box 2
        </Center>
        <Center
          size={16}
          bg="emerald.400"
          rounded="md"
          _text={{
            color: "white",
          }}
          shadow={3}
        >
          Box 3
        </Center>
      </HStack>
    </Stack>
    </Container>
    <Container height="50%" width="100%">
      <Center width="90%"
        bg="primary.400"
        rounded="md"
        _text={{
          color: "white",
      }}>
        Who's Next?
      </Center>
    </Container>
    </SafeAreaView>
  );
}

export default FirstPage;
